import React from "react";
import ProductsWarehouse from "./productsWarehouse";



function Products(){

return<div className="container">
<div className="row row-cols-1 row-cols-sm-2 row-cols-md-4">

{ProductsWarehouse.map(Product=>{

    return<div>

   

     <div className="col"> <div class="card" style="width: 18rem;">
  <div className="card-body">
    <h5 className="card-title">{Product.name}</h5>
    <h6 className="card-subtitle mb-2 text-muted">{Product.emoji}</h6>
    <p className="card-text">{Product.meaning}</p>
    <a href="#" className="card-link">Card link</a>
    <a href="#" className="card-link">Another link</a>
  </div>
</div>

</div>
     {/* <div className="col"></div>
     <div className="col"></div>
     <div className="col"></div> */}
     </div>
})}

  {/* <div className="col">Column</div>
  <div className="col">Column</div>
  <div className="col">Column</div>
  <div className="col">Column</div> */}
</div>
</div>
}
export default Products;
